import { Link, useRouteMatch } from "react-router-dom";
import { AppBar, Grid } from '@mui/material';

const Sidebar = () => {
    let { path, url } = useRouteMatch();

    return (
        <AppBar position={"static"} className="sidebar" >
            <Grid spacing={2} >
                <Grid className="grid">
                    <Link className="link" to="/about/company">Company</Link>
                </Grid>
                <Grid className="grid">
                    <Link className="link" to="/about/jobs">Jobs</Link>
                </Grid>
                <Grid className="grid">
                    <Link className="link" to="/about/jobs/edit">Edit Jobs</Link>
                </Grid>
            </Grid>
        </AppBar>
    );
};


export default Sidebar
